__NUXT_JSONP__("/pages/accessibility-statement", (function(a,b,c){return {data:[{page:{_createdAt:"2021-05-11T22:07:05Z",_id:"42b63201-8884-4bdf-a63c-cedb3633a2a4",_rev:"MWmNCqYHykGVsUkC5Sbypk",_type:"page",_updatedAt:"2021-05-25T11:13:41Z",content:[{_key:"46619b694e6a",_type:a,children:[{_key:"0f02494ae3b7",_type:b,marks:[],text:"Simone Subal Gallery is committed to providing a website that is accessible to the widest possible audience, regardless of technology or ability."}],markDefs:[],style:c},{_key:"0278fe75e9c6",_type:a,children:[{_key:"d83d5849823f0",_type:b,marks:[],text:"We are actively taking steps and devoting resources to further enhance the accessibility of our website to meet or exceed applicable standards. This work is ongoing and as we continue to strive toward our goal of promoting accessibility, we welcome your feedback on how we might improve."}],markDefs:[],style:c},{_key:"ff69a7953849",_type:a,children:[{_key:"c17f080c7f770",_type:b,marks:[],text:"If, at any time, you are experiencing difficulty with any content on simonesubal.com or require assistance with any part of our site, please contact the gallery and we will be happy to assist."}],markDefs:[],style:c},{_key:"6e3cf166b03a",_type:a,children:[{_key:"ce96260b1eba",_type:b,marks:[],text:"Simone Subal Gallery is located on the second floor. There are handrails, however we do not have an elevator. If you have any access needs please do not hesitate to contact us. We are happy to provide additional documentation and information on any of our exhibitions."}],markDefs:[],style:c}],slug:{_type:"slug",current:"accessibility-statement"},title:"Accessibility Statement"}}],fetch:{},mutations:[]}}("block","span","normal")));